import React from "react";
import "../index.css";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import { styled } from "@mui/material/styles";
import Card from "@mui/material/Card";
import { useParams } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faTwitter, faLinkedin, faGithub, faInstagram, faYoutube } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faFile } from "@fortawesome/free-solid-svg-icons";
import { faFilePdf } from "@fortawesome/free-solid-svg-icons";
import {  faExternalLinkAlt } from "@fortawesome/free-solid-svg-icons";
import { useEffect } from "react";
import { Link } from "react-router-dom";
import  Axios  from "axios";
import { Container } from "@mui/system";
import { useState } from "react";
import SocialBar from "../components/social-bar";
import Paper from "@mui/material/Paper";
import { Typography } from "@mui/material";
import { Image } from "@mui/icons-material";



const getProjectById = () => {
  const [project, setProject] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    Axios.get("http://localhost:3000/projects.json")
      .then((response) => {
        setProject(response.data);
        setLoading(false);
      })
      .catch((error) => {
        setError(error);
        setLoading(false);
      });
  }, []);

  return { project, loading, error };
};

function ProjectDetail(props) {
  const { project, loading, error } = getProjectById();
  const { id } = useParams();
  const projectById = { ...project[id - 1]}
  return (

     <Container
      sx={{
     display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        p: "2rem",
      }}
    >
      <div> 
        <img src={projectById.image} 
        alt="project"
        style={{ width: "100%", height: "100%", objectFit: "cover" }}
          />
        </div>
      <div>
        <Typography variant="h4" sx={{ color: "primary.text", fontWeight: "bold", mb: "1rem" }}>
          {projectById.title}
        </Typography>
        <Typography variant="subtitle1" sx={{ color: "primary.text", fontWeight: "bold", mb: "1rem" }}>
          {projectById.description}
        </Typography>
      </div>
      <Box
        sx={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "center",
          alignItems: "center",
          flexWrap: "wrap",
          mb: "1rem",
          gap: "1rem",
        }}
      >
        <Button
          variant="contained"
          sx={{
            backgroundColor: "primary.main",
            color: "white",
            "&:hover": {
              backgroundColor: "primary.dark",
            },
          }}
        >
          <FontAwesomeIcon icon={faFile} />
          <a
            href={projectById.github}
            target="_blank"
            rel="noreferrer"
            style={{ textDecoration: "none", color: "white" }}
          >
            {" "}
            Github
          </a>
        </Button>
        <Button
          variant="contained"
          sx={{
            backgroundColor: "primary.main",
            color: "white",
            "&:hover": {
              backgroundColor: "primary.dark",
            },
          }}
        >
          <FontAwesomeIcon icon={faExternalLinkAlt} />
          <a
            href={projectById.linkedin}
            target="_blank"
            rel="noreferrer"
            style={{ textDecoration: "none", color: "white" }}
          >
            {" "}
            LinkedIn
          </a>
        </Button>
        <Button
          variant="contained"
          sx={{
            backgroundColor: "primary.main",
            color: "white",
            "&:hover": {
              backgroundColor: "primary.dark",
            },
          }}
        > 
          <FontAwesomeIcon icon={faFilePdf} />
          <a
            href={projectById.resume}
            target="_blank"
            rel="noreferrer"
            style={{ textDecoration: "none", color: "white" }}
          >
            {" "}
            Resume
          </a>
        </Button>
      </Box>
      <SocialBar />
    </Container>


   
  
  );
}

export default ProjectDetail;
